import React, { useEffect } from "react";
import logo from "../images/logo.png";
import { Link, useNavigate } from "react-router-dom";
import { Box, Button, Paper } from "@mui/material"; 
import "../../styles/LandingPage.scss";

function Header() {

  const navigate = useNavigate();

  return (
    <Paper elevation={2}>
      <Box display="flex" justifyContent="space-center" alignItems="center">
        <Link to="/">
          <Box component="img" src={logo} alt="" height="48px" />
        </Link>
        <Box>
          <HeaderButton to="#Journey" label="Upcoming Journeys" />

        </Box>
      </Box>
    </Paper>
  );
}

function HeaderButton({ to, label }) {
  return (
    <Link to={to}>
      <Button size="large" style={{ textTransform: "none", color: "black" }}>
        {label}
      </Button>
    </Link>
  );
}

export default Header;
